import React from 'react';
import './style/market_article.css';

export default function MarketArticle() {

  return (
    
    <div class="world-chart flex flex-col w-full lg:flex-row p-5">
      <div class="grid flex-grow h-32 bg-base-300 place-items-center">content</div> 
      <div class="divider lg:divider-horizontal"></div> 
      <div class="grid flex-grow h-32 bg-base-300 place-items-center">content</div>
      <div class="divider lg:divider-horizontal"></div> 
      <div class="grid flex-grow h-32 bg-base-300 place-items-center">content</div>
      <div class="divider lg:divider-horizontal"></div> 
      <div class="grid flex-grow h-32 bg-base-300 place-items-center">content</div>
      <div class="divider lg:divider-horizontal"></div> 
      <div class="grid flex-grow h-32 bg-base-300 place-items-center">content</div>
    </div>
  )
}
